(72, 'RAPPEL / CONSIGNES', 'Chers élèves, salut !\r\n\r\nLa période froide est bientôt là et les températures commencent à baisser. Pour rester au chaud pendant les séances de sport, il est important de porter des vêtements adaptés. Au-dessus ou en dessous de vos tenues de sport habituelles (celles de l’école), les survêtements sont une excellente option pour rester au chaud tout en étant à l’aise. Ils sont légers, confortables et vous permettent de bouger facilement.\r\nN’oubliez pas que le choix des vêtements appropriés peut vous aider à rester en bonne santé en cette période. Alors, habillez-vous chaudement et n’oubliez pas de vous procurer des chaussures adaptées pour le terrain multifonctionnel pour facilement éviter certaines blessures.\r\n\r\nA bientôt !', NULL, 'http://www.schoolrail.com', 'url', '2023-10-30 07:11:13', '2023-10-30 07:11:13', 1, 21),
