(936, 'Activités pour les congés', 'Chaque élève  a la version papier de ces activités. Le parent pourra le réimprimer en cas de perte.\r\nUne évaluation sur ces compétences aura lieu les premières semaines de la rentrée . Prière de veiller  à ce que les activités soient faites. Merci', '1714146706.pdf', '', 'pdf', '2024-04-26 15:51:46', '2024-04-26 20:51:46', 1, 7),
